          <img className='BadgeList__BadgeAvatar' src={null} alt='BadgeAvatar' />
        </div>
        <div className='BadgeList__BadgeInfo-container col-8' >
          <span>Nombre</span>
          <div>@</div>
          <p>JobTitle</p>
        </div>
      </div>
    );
  };
}

